import React, { Component } from 'react'
import { Flex } from 'antd-mobile';



export default class Subject extends Component {

    render() {
        return (
            <div>
                <Flex>
                    <Flex.Item>1</Flex.Item>
                    <Flex.Item>2</Flex.Item>
                    <Flex.Item>2</Flex.Item>
                    <Flex.Item>2</Flex.Item>

                </Flex>
            </div>
        )
    }
}
